import Calender from "../Items/Calender"
import Courses from "../Items/Courses"
import Profile from "../Items/Profile";
import Help from "../Items/Help";

export const MenuData = [
  // {
  //   name: "Dashboard",
  //   to: "/",
  //   iconClassName: "bi bi-speedometer2",
  // },
  {
    name: "Profile",
    to: "/profile",
    iconClassName: "bi bi-person-circle",
    link: <Calender />,
  },
  {
    name: "Courses",
    to: "/",
    // iconClassName: `${BiBook}`,
    iconClassName: "bi bi-book",
    link: <Calender />,
  },
  {
    name: "Calendar",
    to: `/calendert`,
    iconClassName: "bi bi-calendar-plus",
    link: <Calender />,
  },
  {
    name: "Doubts",
    to: `/doubts`,
    iconClassName: "bi bi-question-circle-fill",
    link: <Calender />,
    // subMenus: [
    //   { name: "Courses", to: "/content/courses" },
    //   { name: "Videos", to: "/content/videos" },
    // ],
  },

  {
    name: "Settings",
    to: `/settings`,
    iconClassName: "bi bi-nut",
    link: <Calender />,
  },

  {
    name: "Help",
    to: `/help`,
    iconClassName: "bi bi-telephone",
    link: <Calender />,
  },
];
